def karastuba(x,y,n):
    if n == 1:
        return x*y
    else:
        x1,x2 = split(x,n)
        y1,y2 = split(y,n)
        u = karastuba(x1,y1,n//2)
        v = karastuba(x2,y2,n//2)
        w = karastuba(x1 - x2, y1 - y2,n//2)
